import React, { useEffect, useState } from 'react'
import Card from './Card'

const BIDapp = () => {
    const [search, setSearch] = useState("Search");
    const [newsData, setNewsData] = useState(null)
    const [loading, setLoading] = useState(true);
    const API_KEY = "9c3ed8ee95884dec979460a60f96675b";
    const mockNewsData = [
        {
            title: "165 New Stars Roster Reveal",
            urlToImage: "/2k25-1.jpg",
            url: "#https://www.youtube.com/watch?v=EdYsk6HFPgY",
        },
        {
            title: "Current Male Roster Reveal",
            urlToImage: "/2k25-2.jpg",
            url: "#https://www.youtube.com/watch?v=UNVNxNmYXn8",
        },
        {
            title: "Current Female Roster Reveal",
            urlToImage: "/2k25-3.jpg",
            url: "#https://www.youtube.com/watch?v=HaNmPjuoCpQ&t=1s",
        },
        {
            title: "30 New Stars and 6 New Gimmicks",
            urlToImage: "/2k25-4.jpg",
            url: "#https://www.youtube.com/watch?v=CBXgVaBFyeY",
        },
        {
            title: "Women's Money In The Bank Ladder Match",
            urlToImage: "/2k25-5.jpg",
            url: "#https://www.youtube.com/watch?v=5RchjEwj5mM&t=1s",
        },
        {
            title: "John Cena vs Roman Reigns",
            urlToImage: "/2k25-6.jpg",
            url: "#https://www.youtube.com/watch?v=IZJV-lUg9x4",
        }
    ];
    /*const getData = async() =>{
        const response = await fetch(`https://newsapi.org/v2/everything?q=${search}&apiKey=${API_KEY}`);
        const jsonData = await response.json();
        console.log(jsonData.articles);
        let dt = jsonData.articles.slice(0,10)
        setNewsData(dt)

    }*/
    useEffect(() => {
        // Simulate API call
        setTimeout(() => {
            setNewsData(mockNewsData);
            setLoading(false);
        }, 1000);
    }, []);

    /*useEffect(()=>{
        getData()
    },[])*/

    const handleInput = (e) =>{
        //console.log(e.target.value);
        setSearch(e.target.value)

    }
    const userInput = (event) =>{
        setSearch(event.target.value);
        // In real app, this would trigger a new API call
        console.log("Category selected:", event.target.value);
    }

    const getData = () => {
        setLoading(true);
        // Simulate search
        setTimeout(() => {
            setNewsData(mockNewsData.filter(item => 
                item.title.toLowerCase().includes(search.toLowerCase()) ||
                item.description.toLowerCase().includes(search.toLowerCase())
            ));
            setLoading(false);
        }, 500);
    };
const VideoCard = ({ data }) => (
        <div style={{
            background: '#2a2a2a',
            borderRadius: '8px',
            overflow: 'hidden',
            cursor: 'pointer',
            transition: 'transform 0.2s',
            minWidth: '280px',
            maxWidth: '320px'
        }}>
            <div style={{ position: 'relative' }}>
                <img 
                    src={data.urlToImage} 
                    alt={data.title}
                    style={{
                        width: '100%',
                        height: '180px',
                        objectFit: 'cover'
                    }}
                />
                <div style={{
                    position: 'absolute',
                    bottom: '8px',
                    right: '8px',
                    background: 'rgba(0,0,0,0.8)',
                    color: 'white',
                    padding: '2px 6px',
                    borderRadius: '4px',
                    fontSize: '12px'
                }}>
                    4:45
                </div>
            </div>
            <div style={{
                padding: '12px',
                color: 'white'
            }}>
                <h3 style={{
                    margin: '0 0 8px 0',
                    fontSize: '14px',
                    fontWeight: '600',
                    lineHeight: '1.3'
                }}>
                    {data.title}
                </h3>
                <p style={{
                    margin: '0',
                    fontSize: '12px',
                    color: '#ccc',
                    opacity: '0.8'
                }}>
                    Official
                </p>
            </div>
        </div>
    );
  return (
    <div>
        <nav claasName="nav">
            <div>
                <h1><strong>BURNITDOWN</strong></h1>
            </div>
            <ul style={{display:"flex", gap:"11px", alignItems:"left"}} class="navLinks">
                <li><a style={{fontWeight:600, fontSize:"17px"}}><button>NEWS</button></a></li>
                <li><a style={{fontWeight:600, fontSize:"17px",color:"white"}}><button>TICKETS</button></a></li>
                <li><a href="/Media-kit.pdf" target="_blank" rel="noopener noreferrer" download style={{fontWeight:600, fontSize:"17px",color:"white"}}><button>MEDIAKIT</button></a></li>
                <li><a style={{fontWeight:600, fontSize:"17px",color:"white"}}><button>SHOWS</button></a></li>
                <li><a style={{fontWeight:600, fontSize:"17px",color:"white"}}><button>SHOP</button></a></li>
            </ul>
            <div className='searchBar'>
                <input type='text' placeholder='Search News' value={search} onChange={handleInput}/>
                <button onClick={getData}>Search</button>
            </div>
        </nav>
        <div>
            <p className='head'>Youtube Videos</p>
        </div>
        <div className='categoryBtn'>
            <button onClick={userInput} value="sports">Sports</button>
            <button onClick={userInput} value="politics">Politics</button>
            <button onClick={userInput} value="entertainment">Entertainment</button>
            <button onClick={userInput} value="health">Health</button>
            <button onClick={userInput} value="fitness">Fitness</button>
        </div>

        <div>
        {newsData?  <Card data={newsData}/> : null}

        </div>
    </div>
  )
}

export default BIDapp
